import React, { useState, useEffect } from "react";

function Users() {
  return (
    <>
      {" "}
      <div className="person">
        <img
          className="avatar"
          src="https://th.bing.com/th/id/R.2c94896c7dfdba6537f79116afef19fa?rik=PEsflNdMoEM6lg&riu=http%3a%2f%2fproheadshots.today%2fwp-content%2fuploads%2f2019%2f01%2fface-facial-hair-low.jpg&ehk=YqtIqpaFQox9cpJKZgcBt%2fmEo%2b9nyahpk4aCZVbZUXk%3d&risl=&pid=ImgRaw&r=0"
        ></img>
        <div className="info">
          <h1>Devid Fincher</h1>
          <p>devid.fincher@gmail.com</p>
        </div>
        <svg
          xmlns="http://www.w3.org/2000/svg"
          height="24"
          viewBox="0 -960 960 960"
          width="26"
        >
          <path d="M440-440H200v-80h240v-240h80v240h240v80H520v240h-80v-240Z" />
        </svg>{" "}
      </div>
    </>
  );
}

function Invit() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch("https://reqres.in/api/users")
      .then((res) => {
        if (!res.ok) {
          throw new Error("Network response was not ok");
        }
        return res.json();
      })
      .then((json) => {
        setUsers(json.data);
      })
      .catch((err) => {
        console.warn(err);
        alert("An error occurred");
      });
  }, []);
  return (
    <div className="invit">
      <div className="invit_content">
        <form className="form">
          <input className="input" placeholder="find user..."></input>{" "}
        </form>
        <Users />
        <button>send offer</button>
      </div>
    </div>
  );
}

export default Invit;
